import { View, Text, Image, TouchableOpacity } from "react-native";
import styles from "./style/resItem.style";
import React from "react";
import CommunityMaterialIcons from "react-native-vector-icons/Ionicons";
import { ITEMS } from "./item.constants";

const RestaurantItemInfor = () =>
  ITEMS.map((item, index) => (
    <TouchableOpacity key={index} activeOpacity={0.5}>
      <View style={styles.resItemWrapper}>
        <Image source={item.image} style={styles.itemImg} />
        <CommunityMaterialIcons
          name="heart-outline"
          size={25}
          style={styles.heartIcon}
          color="white"
        />
        <View style={styles.resItemInforWrapper}>
          <View style={styles.basicInfWrapper}>
            <Text style={styles.itemName}>{item.name}</Text>
            <Text style={styles.itemTime}>30 - 45 - mins</Text>
          </View>
          <View style={styles.itemRateWrapper}>
            <Text style={styles.itemRate}>4.5</Text>
          </View>
        </View>
      </View>
    </TouchableOpacity>
  ));

export default function RestaurantItem(props) {
  const img = require("../../assets/image/mixao.jpeg");
  return <View>{RestaurantItemInfor()}</View>;
}
